import React from "react"

class Loginpage extends React.Component {
    render() {
        return (
            <form className="loginForm">
                <h1>Admin Panel</h1>
                <div>
                    <input
                        className="loginFormInput"
                        type="text"
                        placeholder="Login"
                        required                
                    />
                </div>

                <div>
                    <input
                        className="loginFormInput"
                        type="password"
                        placeholder="Password"
                        required                
                    />
                </div>

                <div>
                    <button>Login</button>
                </div>
            </form>
        )
    }
}

